  };

  return (
    <>
      <Nav />
      <div className="form-box">
        <div className="form-value">
          <form action="">
            <h2>Login</h2>
            <div className="inputbox">
              <input type="email" required></input>
              <label>Email</label>
            </div>
            <div className="inputbox">
              <input type="password" required></input>
